import React from "react";
import ReactDOM from "react-dom";
import NoHelloWorld from "./components/NoHelloWorld";

const shirts = 4;
const pants = 6;
const website = "https://www.thinkful.com/";

const element = null;

function App(){
    const p = (
        <main>
        <NoHelloWorld />
        <p className="paragraph">
            Purchased {shirts} shirts and {pants} pants for a total 
            of {shirts + pants} items
        </p>
        <a href={website}>Website</a>
    </main>
    )
    return p;
}

export default App;
